.jpg','images/201507/source_img/45_G_1437624172022.jpg',1,'',0,1,0,1,1437624172,100,0,0,0,0,0,9,7,1443398654,0,'',-1,-1,0,NULL,1,'1.20','images/201507/thumb_img/45_thumb_G_1437624172207.jpg',10,NULL,0,'0.00',0,0,0),(46,1,'HHS000046','【测试商品-网站演示专用】鸭脖','+',235,0,'',9993,'0.000','0.24','0.20','0.00',0,0,1,'','','<p>\r\n	<span style=\"font-family:arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">鸭脖子，又名</span><a href=\"http://baike.haosou.com/doc/1390584-1470153.html\" target=\"_blank\">酱鸭脖</a><span style=\"font-family:arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">或酱鸭脖子，湖南，湖北，四川等地汉族传统名吃之一。属于酱汁类食品(主要是鸭脖，酱板鸭、包括</span><a href=\"http://baike.haosou.com/doc/1185788-1254346.html\" target=\"_blank\">酱鸭翅</a><span style=\"font-family:arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">、酱鸭脖、酱鸭拐、酱鸭掌、酱鸭舌、</span><a href=\"http://baike.haosou.com/doc/5351834-5587292.html\" target=\"_blank\">酱牛肉</a><span style=\"font-family:arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">、酱板鱼、酱板干子、酱板藕等)，最早起源流传于清朝</span><a href=\"http://baike.haosou.com/doc/6010190-6223176.html\" target=\"_blank\">洞庭湖区</a><span style=\"font-family:arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">的常德，经湖南流传至四川和湖北，近年来风靡全国。酱汁类食品通过多种香料浸泡，然后经过风干、烤制等工序精致而成，成品色泽深红，具有香、辣、甘、麻、咸、 酥、绵等特点，是一道开胃、佐酒佳肴。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\"><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\"> </span>\r\n</p>\r\n<p style=\"font-family:arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	鸭脖子，又名<a target=\"_blank\" href=\"http://baike.haosou.com/doc/1390584.html\">酱鸭脖</a>或酱鸭脖子，属于<a target=\"_blank\" href=\"http://baike.haosou.com/doc/5628388.html\">酱汁</a>类食品（主要是<a target=\"_blank\" href=\"http://baike.haosou.com/doc/5628380.html\">酱板鸭</a>，包括<a target=\"_blank\" href=\"http://baike.haosou.com/doc/6260678.html\">麻辣诱惑</a>鸭脖、酱鸭<a href=\"http://i3.qhimg.com/t016abb4ce8cab13117.jpg\" class=\"show_img layoutright\"><img id=\"img_1339598\" src=\"http://i3.qhimg.com/dr/200__/t016abb4ce8cab13117.jpg\" /><span></span></a>翅、酱鸭脖、酱鸭拐、酱鸭掌、<a target=\"_blank\" href=\"http://baike.haosou.com/doc/5629087.html\">酱鸭舌</a>、<a target=\"_blank\" href=\"http://baike.haosou.com/doc/5351834.html\">酱牛肉</a>、酱板鱼、酱板干子、酱板藕等），最早起源流传于清朝<a target=\"_blank\" href=\"http://baike.haosou.com/doc/6010190.html\">洞庭湖区</a>的<a target=\"_blank\" href=\"http://baike.haosou.com/doc/5567078.html\">常德</a>，经<a target=\"_blank\" href=\"http://baike.haosou.com/doc/4027470.html\">湖南</a>流传至<a target=\"_blank\" href=\"http://baike.haosou.com/doc/2871728.html\">四川</a>和<a target=\"_blank\" href=\"http://baike.haosou.com/doc/322670.html\">湖北</a>，近年来风靡全国。酱汁类食品通过多种<a target=\"_blank\" href=\"http://baike.haosou.com/doc/5406977.html\">香料</a>浸泡，然后经过风干、烤制等工序精致而成，成品色泽深红，具有香、辣、甘、麻、咸、酥、绵等特点，是一道佐酒佳肴。\r\n</p>\r\n<p style=\"font-family:arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	二十世纪九十年代初，汤腊九在<a target=\"_blank\" href=\"http://baike.haosou.com/doc/2453672.html\">成都</a>学习<a target=\"_blank\" href=\"http://baike.haosou.com/doc/5539567.html\">卤菜</a>技术和中药材配方，回<a target=\"_blank\" href=\"http://baike.haosou.com/doc/498920.html\">武汉</a>后，开起了首家鸭脖子专卖店。\r\n</p>\r\n<br />\r\n<p>\r\n	<br />\r\n</p>','images/201507/thumb_img/46_thumb_G_1437624260674.jpg','images/201507/goods_img/46_G_1437624260954.jpg','images/201507/source_img/46_G_1437624260553.jpg',1,'',0,1,0,0,1437624260,3,0,0,0,0,0,0,7,1443398655,0,'',-1,-1,0,NULL,5,'1.00','images/201507/1438214431620009830.jpg',5,1,0,'0.00',0,0,0),(47,1,'HHS000047','【测试商品-网站演示专用】姐妹果干组合套装','+',27,0,'',10000,'0.000','118.80','99.00','0.00',0,0,1,'','','','images/201507/thumb_img/47_thumb_G_1437624459936.jpg','images/201507/goods_img/47_G_1437624459123.jpg','images/201507/source_img/47_