arge;\"><strong><span style=\"color:#FF0000;\">厚度可以做到10mm以下</span></strong></span>。\r\n</p>','','','',1,'',0,1,0,0,1438822822,100,0,0,0,0,0,0,7,1441044898,0,'',-1,-1,0,NULL,5,'2.00','',0,NULL,0,'0.00',0,0,0),(52,1,'HHS000052','【测试商品-网站演示专用】cishi','+',24,0,'',9996,'0.000','144.00','120.00','0.00',0,0,1,'','','','','','',1,'',1,1,0,0,1438822862,100,0,0,0,0,0,0,7,1443398644,0,'',-1,-1,0,NULL,5,'1.20','',0,NULL,0,'0.00',0,0,0),(53,47,'HHS000053','【测试商品-网站演示专用】皇冠AK菠萝蜜100g越南进口零食 菠萝密干休闲食品进口果干','+',4,0,'',9998,'0.000','14.39','11.99','0.00',0,0,1,'','','','images/201508/thumb_img/53_thumb_G_1438902281381.jpg','images/201508/goods_img/53_G_1438902281201.jpg','images/201508/source_img/53_G_1438902281790.png',1,'',0,1,0,0,1438902281,100,0,0,0,0,0,0,7,1443398660,11,'',-1,-1,0,NULL,1,'1.00','',0,NULL,0,'0.00',0,0,0),(54,47,'HHS000054','【测试商品-网站演示专用】淘宝热卖 非律宾进口零食 多重防伪菲律宾特产 新包装7D芒果干','+',19,0,'',9999,'0.000','7.19','5.99','0.00',0,0,1,'','','','images/201508/thumb_img/54_thumb_G_1438903660283.jpg','images/201508/goods_img/54_G_1438903660621.jpg','images/201508/source_img/54_G_1438903660968.png',1,'',1,1,0,0,1438903660,100,0,0,0,0,0,0,7,1443398641,11,'',-1,-1,0,NULL,1,'1.00','',0,NULL,0,'0.00',0,0,0),(55,47,'HHS000055','【测试商品-网站演示专用】美国山核桃碧根果长寿果500g罐装','+',3,0,'',9998,'0.000','54.00','45.00','0.00',0,0,1,'','','','images/201508/thumb_img/55_thumb_G_1438905362194.jpg','images/201508/goods_img/55_G_1438905362896.jpg','images/201508/source_img/55_G_1438905362313.png',1,'',0,1,0,0,1438905362,100,0,0,0,0,0,0,7,1448053814,11,'',-1,-1,0,NULL,1,'1.00','',0,NULL,0,'0.00',0,0,0),(56,47,'HHS000056','【测试商品-网站演示专用】乌梅干休闲蜜饯果干果脯美味约50g','+',3,0,'',9999,'0.000','1.44','1.20','0.00',0,0,1,'','','','images/201508/thumb_img/56_thumb_G_1438905669190.jpg','images/201508/goods_img/56_G_1438905669663.jpg','images/201508/source_img/56_G_1438905669671.png',1,'',0,1,0,0,1438905669,100,0,0,0,0,0,0,7,1442281763,11,'',-1,-1,0,NULL,1,'1.00','',0,NULL,0,'0.00',0,0,0),(57,47,'HHS000057','【测试商品-网站演示专用】草莓干','+',3,0,'',