/*Table structure for table `hhs_role` */

DROP TABLE IF EXISTS `hhs_role`;

CREATE TABLE `hhs_role` (
  `role_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `role_name` varchar(60) NOT NULL DEFAULT '',
  `action_list` text NOT NULL,
  `role_describe` text,
  PRIMARY KEY (`role_id`),
  KEY `user_name` (`role_name`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `hhs_role` */

/*Table structure for table `hhs_searchengine` */

DROP TABLE IF EXISTS `hhs_searchengine`;

CREATE TABLE `hhs_searchengine` (
  `date` date NOT NULL DEFAULT '0000-00-00',
  `searchengine` varchar(20) NOT NULL DEFAULT '',
  `count` mediumint(8) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`date`,`searchengine`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `hhs_searchengine` */

/*Table structure for table `hhs_send_bonus_type` */

DROP TABLE IF EXISTS `hhs_send_bonus_type`;

CREATE TABLE `hhs_send_bonus_type` (
  `send_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '发放者id',
  `add_time` int(11) NOT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态1 开启 0 关 3 已发完',
  `type_id` int(11) NOT NULL COMMENT '优惠券类型',
  `send_order_id` int(11) DEFAULT '0' COMMENT '订单id',
  `send_number` int(11) DEFAULT '0' COMMENT '发送的数量',
  PRIMARY KEY (`send_id`)
